function getIndex(start, end, interval, length, x) {
    if (arguments.length == 2) {
        start = arguments[0].start;
        end = arguments[0].end;
        interval = arguments[0].interval;
        length = arguments[0].length;
        x = arguments[1];
    } else if (arguments.length != 5) {
        throw "输入参数错误"
    }
    let xlength = (x - start) / interval;
    let idx = Math.floor(xlength);
    if (idx > length - 2) {
        idx = length - 2;
    } else if (idx < 0) {
        idx = 0;
    }
    let diff = xlength - idx;
    return {
        idx: idx,
        diff: diff
    };
};
function linearValue(x1, y1, x2, y2, x) {
    if (arguments.length == 2) {
        x1 = arguments[0].x1;
        x2 = arguments[0].x2;
        y1 = arguments[0].y1;
        y2 = arguments[0].x2;
        x = arguments[1];
    } else if (arguments.length != 5) {
        throw "输入参数错误"
    }
    return (y2 - y1) / (x2 - x1) * (x - x1) + y1;
};
